USE casemix_dev; -- replace with your database name

DROP TABLE IF EXISTS `patientsurgeryprogresses`;

CREATE TABLE `patientsurgeryprogresses` (
  `Id` int(11) NOT NULL,
  `PatientId` varchar(30) DEFAULT NULL,
  `UserId` varchar(30) DEFAULT NULL,
  `SurgeonId` varchar(30) DEFAULT NULL,
  `AnaesthesiaId` varchar(30) DEFAULT NULL,
  `ProcedureCode` varchar(20) DEFAULT NULL,
  `SurgeryDate` date DEFAULT NULL,
  `AdmissionCheckinTime` timestamp NULL DEFAULT NULL,
  `AdmissionCheckoutTime` timestamp NULL DEFAULT NULL,
  `WaitingCheckinTime` timestamp NULL DEFAULT NULL,
  `WaitingCheckoutTime` timestamp NULL DEFAULT NULL,
  `PreparationCheckinTime` timestamp NULL DEFAULT NULL,
  `PreparationCheckoutTime` timestamp NULL DEFAULT NULL,
  `AnaesthesiaCheckinTime` timestamp NULL DEFAULT NULL,
  `AnaesthesiaCheckoutTime` timestamp NULL DEFAULT NULL,
  `SurgeryCheckinTime` timestamp NULL DEFAULT NULL,
  `SurgeryCheckoutTime` timestamp NULL DEFAULT NULL,
  `RecoveryCheckinTime` timestamp NULL DEFAULT NULL,
  `RecoveryCheckoutTime` timestamp NULL DEFAULT NULL,
  `AdmissionNotes` varchar(200) DEFAULT NULL,
  `WaitingAreaNotes` varchar(200) DEFAULT NULL,
  `PreparationNotes` varchar(200) DEFAULT NULL,
  `AnaesthesiaNotes` varchar(200) DEFAULT NULL,
  `SurgeryNotes` varchar(200) DEFAULT NULL,
  `RecoveryNotes` varchar(200) DEFAULT NULL,
  `ProcedureTypeDefinition` varchar(100) DEFAULT NULL,
  `SnomedId` int(11) DEFAULT NULL,
  `SnomedDesc` varchar(150) DEFAULT NULL,
  PRIMARY KEY (`Id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

